window.bookSummaryJSON = "<p>I spent my life pretending to be just a normal witch, on the run from the Black Guard. But I'm a seer. My ability is to see the future.</p> <p>So why don't I see a way out of this mess?</p> <p>Bane, the bounty hunter, Ambrose, the alpha shifter, and Christian, the king vampire, and I are trapped together in a dying prison. The warden is determined not just to make sure we never escape, but that we never see the light of day againâ€”and he's ready to burn down the prison and kill everyone to make sure we never tell anyone about his corrupt dealings.</p> <p>But with these powerful males by my side, we might just be able to save not just ourselves, but all the supes, in and out of Nightstone.</p> <p>Contains mature themes.</p>"; 
